INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1925453, 'Whose Side Are You On?', 'Naturi Naughton, Elizabeth Rodriguez, Monica Mitchell, and rapper Fabolous discuss the second episode of Power Season Six, "Whose Side Are You On?" Hosted by Terrence J.', 93433, 2, 1925453, 132034, '2019-09-02');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1925454, 'Forgot About Dre', 'Curtis "50 Cent" Jackson, Rotimi, and Larenz Tate discuss the third episode of Power Season Six, "Forgot About Dre." Hosted by Terrence J.', 93433, 3, 1925454, 132034, '2019-09-09');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1925572, 'Episode 1', '', 93447, 1, 1925572, 132053, '2018-04-25');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1925843, 'Pilot', 'Megan has a job interview and needs Greg to leave work early to watch the kids, but Greg is unprepared for the storm that awaits.', 93457, 1, 1925843, 132074, '2019-09-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1929666, 'What About the Kids?', 'A big decision looms after Megan snares an unexpected job offer and Greg realizes his own career is stuck in neutral.', 93457, 2, 1929666, 132074, '2019-09-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940655, 'The List', 'Megan has first day jitters at her new job while Greg tries to stick to a tight schedule at the house.', 93457, 3, 1940655, 132074, '2019-09-19');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940658, 'The Sandman', 'Megan and Greg will try just about anything to get Zack to sleep.', 93457, 4, 1940658, 132074, '2019-09-26');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940659, 'Good Cop, Good Cop', 'Megan and Greg resort to parenting shortcuts to win over their kids.', 93457, 5, 1940659, 132074, '2019-10-03');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940660, 'Date Night', 'Megan and Greg head out for a date night that''s anything but ordinary.', 93457, 6, 1940660, 132074, '2019-10-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940661, 'The Salad Days', 'Flashback to the beginning, when Greg and Megan first met and how their relationship has grown since - from the carefree honeymoon stage to the chaos of parenting.', 93457, 7, 1940661, 132074, '2019-10-17');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940665, 'Pitches Be Crazy', 'While Megan hits her stride at work, Greg''s start-up takes a nosedive.', 93457, 8, 1940665, 132074, '2019-10-24');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940666, 'Crickets', 'Greg is no match for Uncle Kenny''s adventure stories and gifts.', 93457, 9, 1940666, 132074, '2019-10-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940667, 'Sick Day', 'Megan gets sick on a business trip just before her big pitch, while Greg is forced to bring the kids into the city for a meeting with his last potential investor.', 93457, 10, 1940667, 132074, '2019-11-07');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940668, 'Three, Two, One', 'Megan is hesitant to accept a promotion in light of Greg''s recent parenting choices, and Greg has some momentous news of his own.', 93457, 11, 1940668, 132074, '2019-11-14');
