INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926258, 'Setting the Targets', 'Sid works as a stand-up comedian at Durga Devi’s club and is discreetly gathering information about her empire. Durga Devi (DD) punishes Goswami for revealing the casino’s secrets to a stranger resulting in a loss of Rs 1 crore. Later, DD is rescued by Sid during a bank heist. Meanwhile, Roshni is upset with her mother, DD, for separating her from Ranjit. DD notices Sid performing at the club and begins to keep an eye on him.', 93467, 1, 1926258, 132088, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926314, 'Twist of Love', 'Police officer Cheeram starts investigating the bank robbery and starts suspecting DD for her presence at the bank. Sid informs Roshni, who is shocked to find herself waking up at his apartment, that she had an accident. Meanwhile, Goswami gets in touch with Roshni and tells her that Ranjit is alive and he can unite them if she helps him get back his business data from DD.', 93467, 2, 1926314, 132088, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926315, 'The Dual Life Begins', '"Roshni and Sid have a romantic moment and confess their attraction to each other. Cheeram starts scheming against DD with the support of his seniors. When shows an interest in joining the business, DD successfully hides her illegal activities from her. Later, Roshni sees Sid perform a stand-up act for DD’s special friend. Sid once again rescues DD when Cheeram raids her drug deal. "', 93467, 3, 1926315, 132088, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926316, 'Avenger or Lover?', 'While Vaibhav gets arrested during the raid, Jatin manages to escape. Cheeram is convinced of DD''s presence during the drug deal and reaches her house but finds her missing. Roshni shares her concern about Ranjit with Sid. Meanwhile, Cheeram finds out that Sid was present during the drug deal. Later, Sid rescues Roshni from some goons.', 93467, 4, 1926316, 132088, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926317, 'You Interefere, You Die!', 'Vaibhav agrees to go against DD when Cheeram offers to set him free on the condition that he betrays his boss. DD confronts Roshni about her interaction with Goswami and threatens Goswami to stay away from her daughter. Meanwhile, Jatin slips into a coma when Sid attacks him. With no option left, DD decides to appoint Sid as Roshni’s bodyguard.', 93467, 5, 1926317, 132088, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926318, 'Time for a Heartbreak', 'Roshni reaches home to find her childhood friend Paritosh at her place. She continues to search for Goswami’s information on DD’s laptop. After his meeting with Roshni, Paritosh goes to DD and informs her that Roshni is dating someone. Meanwhile, when Roshni reaches Sid’s house, she finds that he has been arrested and confronts him.', 93467, 6, 1926318, 132088, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926319, 'The Proposal', 'Roshni is shocked to see DD and Sid enter the house together. DD informs Vaibhav that Sid will soon be going for a drug deal. Paritosh proposes to Roshni after she goes on a date with him. She later uses Paritosh as a cover-up to visit the bank where she receives a diary and pen drive, which she hands over to Goswami.', 93467, 7, 1926319, 132088, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927215, 'Memory', 'How does remembering work? Delve into the way the brain stores, processes and retrieves memories -- and why certain ones sometimes prove unreliable.', 93514, 1, 1927215, 132161, '2019-09-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1934420, 'Episode 5', '', 93582, 5, 1934420, 132297, '2019-09-26');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926320, 'Tragedy Unites the Lovers', 'Paritosh informs DD that he has proposed to Roshni and accompanies Roshni to the village. DD orders Sid to accompany Roshni to the village and get Ranjit killed. Meanwhile, Goswami discovers that there is nothing in the pen drive and diary. Madhav informs Shefali that Vaibhav is planning to betray DD.', 93467, 8, 1926320, 132088, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926321, 'Who Will Win?', 'DD comes to know about Vaibhav’s plan and gets him abducted. Cheeram desperately looks for Vaibhav to find the new location of the drug deal. Meanwhile, DD informs her men to mislead Cheeram about the deal and completes it. Later, Roshni and Sid confess their love for each other to DD. But Roshni soon lands in trouble when Dev comes to kidnap her.', 93467, 9, 1926321, 132088, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926322, 'The Big Secret', 'Vaikunth reaches the resort to arrest DD but she escapes with Sid through a secret passage. Sid promises DD that he will save Roshni at any cost and arrives at Goswami’s hideout where he is attacked by goons. Just then, Cheeram reaches and rescues Sid and Roshni. DD accepts Sid and Roshni’s relationship and tells them to be in a live-in-relationship and get to know each other. Sid moves in to DD’s house and prepares to take his mission to the next level.', 93467, 10, 1926322, 132088, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926467, 'Episode 1', 'Wealthy London housewife Simeone Cooper has to return to her home town in Australia, where she is forced revisit the past and finally face up to the friends and family she left behind - who only ever knew her as Sammy.', 93479, 1, 1926467, 132111, '2019-09-26');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939272, 'Episode 2', 'Sammy starts working for an old school mate, who''s keen to punish her for the past. Her ex also makes it clear he hasn''t forgiven her.', 93479, 2, 1939272, 132111, '2019-10-03');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939273, 'Episode 3', 'Sammy goes snooping for evidence to blackmail Chris. Lenny pals up with a fellow misfit and a date lands Jean in hot water.', 93479, 3, 1939273, 132111, '2019-10-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939274, 'Episode 4', 'Sammy pitches her partnership deal to Chris during a business trip. But then an incident in a casino puts her in an awkward situation.', 93479, 4, 1939274, 132111, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939275, 'Episode 5', 'After a harsh realisation, Sammy aims to reclaim her worth by helping at the school disco. But the dance soon turns into a debacle.', 93479, 5, 1939275, 132111, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939277, 'Episode 6', 'Sammy gets good news about her husband''s estate. But as she plans their escape, things prove far more complicated than she imagined.', 93479, 6, 1939277, 132111, null);
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926493, 'Chala Toh Chaand Tak, Nahin Toh Shaam Tak', 'ISA scientist Moushami Ghosh faces her biggest setback when her team loses contact with India’s ChandraViman-1 while China’s mission to the moon succeeds. As India sets its eyes on Mars, China once again beats it with another successful mission even before Moushami and her team can get approval for India’s Mars mission.', 93480, 1, 1926493, 132114, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927435, 'To Mars', 'The PMO office agrees to fund M.O.M on the condition that the mission is launched within 18 months. The ISA agrees to this condition. Team M.O.M, headed by Nandita, must now prove the skeptics wrong and make M.O.M a success.', 93480, 2, 1927435, 132114, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927436, '7 Rupees Per Kilometers', 'Nandita is devasted when the Centre allocates only USD 75 Million for the entire mission. She tries some cost-cutting measures but still finds it difficult to work within the limited budget. Later, MSLV fails its first test launch. Can ISA afford a second test launch?', 93480, 3, 1927436, 132114, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927437, 'Phuljhadi Wala Rocket', 'After MSLV fails the test for the second time, Moushami suggests that they use the tried and test ESLV instead. But it only has a success rate of 36 percent. Will Nandita and her team be able to pull off a third test launch?', 93480, 4, 1927437, 132114, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927438, '100% Indian', 'In the review meeting, Moushumi and her team fail to present their complete plan. Moushumi offers to step down as she may have overestimated her capabilities. Later, Gautam offers to seek the help of the American space agency, but Dr. Murlidharan is adamant about keeping M.O.M a 100 % Indian program.', 93480, 5, 1927438, 132114, '2019-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927439, 'Vighnaharta Ganesha', 'Dr. Gokhale complains to the PMO office about procedural irregularities in the M.O.M mission. Dr. Murlidharan speaks to the team and finds out that taking care of the irregularity would mean delaying the mission by 8 months. The entire mission now risks being shelved.', 93480, 6, 1927439, 132114, '2019-09-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927440, 'Never Say Never', 'The ISA scientists visit the PMO to seek approval for international co-operation for the mission. But the request gets stuck due to bureaucracy. The team tries to find a way around this. Later, just a few minutes before the launch, the mission is aborted due to bad weather. The M.O.M is declared dead for now.', 93480, 7, 1927440, 132114, '2019-09-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1929832, 'Super Computer Vs Us', 'M.O.M is far from being termed as a successful mission until it lands on Mars. Moushumi and Neetu realize that the supercomputers may be making a grave error in calculations. M.O.M finally leaves Earth''s orbit but soon loses contact.', 93480, 8, 1929832, 132114, '2019-09-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926609, 'Episode 1', 'In the summer of 2006 detectives Rob Reilly and Cassie Maddox are sent to investigate a child’s murder. They find a community caught between the old Ireland and the new.', 93481, 1, 1926609, 132118, '2019-10-14');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926622, 'Episode 2', 'Despite Rob’s promise to Cassie that they won’t investigate Operation Vestal, they make a dark bargain to keep the secret and carry on working on the cases.', 93481, 2, 1926622, 132118, '2019-10-15');
