INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926942, 'Episode 1', 'As the castaways hit land, a helicopter drops a box of cash on the north shore. With the light fading, do the group chase the money or try to make camp?', 93499, 1, 1926942, 132140, '2019-09-08');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1926944, 'Episode 2', 'The Islanders are struggling but Jack wrestles a python for dinner. Emily and Elissa spot a box of money looking for water. Do they tell Cat or hide the cash while her back is turned?', 93499, 2, 1926944, 132140, '2019-09-15');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1929243, 'Episode 3', 'The group are barely subsisting on coconuts and winkles. With suspicions on the rise about the hidden cash, Morag takes action that threatens to tear the islanders apart.', 93499, 3, 1929243, 132140, '2019-09-22');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1935154, 'Episode 4', 'Seven days without a real meal and the group''s falling apart. With tensions over money high, Morag''s frustrations boil over. Jack and Ben take on ex-marine Marco in a race for cash.', 93499, 4, 1935154, 132140, '2019-09-29');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940886, 'Episode 5', 'After days of hunger and bickering over cash, the end is in sight for the Islanders. But with £35k still to be discovered, people must still decide whether to share the money or keep it for themselves.', 93499, 5, 1940886, 132140, '2019-10-06');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1945397, 'Surviving the Island', 'Bear Grylls returns to pick up the 11 remaining islanders, and to find out how they made it to the end. The group reflect on how they coped with the brutal conditions and with each other, revealing how the money drove them to explore more.', 93499, 6, 1945397, 132140, '2019-10-06');
