INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927216, 'Dreams', 'Why do we dream? When the lights go out, interesting things happen in the brain and body. What’s the significance of dreams, and what can they teach us?', 93514, 2, 1927216, 132161, '2019-09-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927217, 'Anxiety', 'Feeling anxious? You''re not alone. Stand-up comedian Maria Bamford shares her personal experience with OCD in this examination of anxiety disorders.', 93514, 3, 1927217, 132161, '2019-09-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927218, 'Mindfulness', 'Take a deep, cleansing breath and slowly exhale while being enlightened on the impact meditation can have on your mind and body.', 93514, 4, 1927218, 132161, '2019-09-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927219, 'Psychedelics', 'What happens to a brain on psychedelics? Turn on, tune in and drop out on this trip to explore the history and effects of mind-altering substances.', 93514, 5, 1927219, 132161, '2019-09-12');
