INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1927982, 'deep blue', 'Ao, after walking his childhood friend, Naru Arata, back to her home, stumbles upon smugglers Gazelle, Pippo and Han Juno. When a Scub Coral suddenly appears, Ao runs back to his house, accidentally taking a bracelet that the three were smuggling to the Japanese Armed Forces. The smugglers discover that the bracelet has gone missing, and they go to find Ao to retrieve it back the next day. When another Scub Coral appears containing a G-Monster, it wreaks havoc all over Iwato Jima. Ao soon realizes that the bracelet is one owned by his long-lost mother, Eureka.', 93537, 1, 1927982, 132217, '2012-04-13');
