INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928140, 'Bruk Up', 'Streetwise Jamie looks to lead a gang and cut old ties for a new supplier. In Jamaica, a hardened criminal Dushane is at the mercy of a powerful kingpin.', 93544, 1, 1928140, 132226, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928142, 'Building Bridges', 'Dushane returns to London. Jamie juggles family duties with risky responsibilities. Before his prison release, convict Sully is provoked by an inmate.', 93544, 2, 1928142, 132226, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928143, 'Big Flame', 'Strapped for cash, Dushane makes a proposition to an old friend and attempts burglary. Beefing with a rival gang, Jamie struggles to keep a low profile.', 93544, 3, 1928143, 132226, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928144, 'Bonfire Night', 'The feud between the Fields and the A-Roads escalates. A fiery attack puts Sully and Jason in peril. Dushane''s plans take an unexpected turn.', 93544, 4, 1928144, 132226, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928145, 'Smoke Get in Your Hands', 'As the money rolls in for Dushane and Sully''s crew, a threat gets wind of their booming business -- and neither party is ready to give up their turf.', 93544, 5, 1928145, 132226, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928149, 'Press Gang', 'As the Zero Tolerance gang asserts their power, Dushane''s crew attempts to hire young recruits. When Sully becomes a target, the group prepares for war.', 93544, 6, 1928149, 132226, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928150, 'The Squeeze', 'Ats makes his first delivery. Jamie''s punishment for a detractor goes awry. After a warning from Haze, Dushane looks to eliminate the competition.', 93544, 7, 1928150, 132226, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928151, 'Bad Eye', 'A familiar face breaks free from jail and confronts Jamie about his self-appointed leadership. Lizzie is forced to change her business strategy.', 93544, 8, 1928151, 132226, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928152, 'Everyone''s Got Family', 'Bent on taking out Sugar and Jamie, Dushane and Sully orchestrate hits on their rivals -- until a surprise shootout shakes up their plans.', 93544, 9, 1928152, 132226, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928153, 'You Don''t Know Me', 'When an enemy''s takedown puts Jamie back in a position of power, Dushane and Sully use their slick tactics to outsmart him.', 93544, 10, 1928153, 132226, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1928340, 'Grandpa''s Drum/Have Canoe, Will Paddle', 'Molly finds a photo of Grandpa as a child and is shocked to see him singing and drumming-Grandpa never sings. Then, the Qyah Canoers are ready for their competition. There''s just one problem: Molly, Tooey, and Trini don''t know how to canoe!', 93548, 1, 1928340, 132236, '2019-07-15');
