INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930360, 'Middle East Favorites', 'The light and bright recipes of the Middle East. Includes salmon chraimeh; bulgur-tomato salad with herbs and pomegranate molasses; and tangerine-almond cake with bay-citrus syrup.', 93645, 15, 1930360, 132395, '2018-12-14');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930361, 'New Breads', 'How to make aromatic, nutty and tender pumpkin seed rolls; Portuguese cornbread; and Macanese sweet potato cake.', 93645, 16, 1930361, 132395, '2018-12-21');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930091, 'Episode 1', 'After having their DNA tested, Ian Thorpe, Ernie Dingo, and Julia Zemiro set off on an epic journey of genetic time travel to find out where they, and the rest of humankind, come from. In this episode, they head towards the Serengeti plains in northern Tanzania, 20,000 years to the beginnings of humankind. They meet the Hadzabe people, one of the last remaining hunter-gatherer tribes on earth. Living off the land, they still use ancient methods to survive.', 93625, 1, 1930091, 132369, '2016-05-22');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930092, 'Episode 2', 'Julia and Ian journey to Israel and discover the percentage of Neanderthal DNA they each carry. Ernie''s DNA reveals an ancient connection to the people of India. He makes his way south to the remote rural village of Isko, home to the Munda people, and discovers the deep and surprising links he has with this Indian tribe. Meanwhile in Australia, the unique genetic census of everyday Australians continues and DNA results reveal that identity really is more than skin deep.', 93625, 2, 1930092, 132369, '2016-05-29');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930093, 'Episode 3', 'In this final episode, Ian''s in the grasslands of Kyrgyzstan in the former Soviet Union to discover how his ancestors'' horse-taming skills and the invention of the wheel changed the course of human history. Julia Zemiro''s father''s ancestors were on the beautiful island of Sardinia, off the west coast of Italy. Ernie Dingo''s genetic map leads him to Timor Leste, where he learns of humankinds'' greatest ever achievements - the journey to arrive on the shores of Australia for the first time.', 93625, 3, 1930093, 132369, '2016-06-05');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930324, 'Homecooking, Chinese Style', 'Christopher Kimball visits Fuchsia Dunlop in London to learn about the Chinese approach to cooking. Chinese white-cooked chicken with ginger-soy dressing; using an Asian cleaver vs. a Western chef''s knife; hot oil-flashed chard with ginger scallions and chili.', 93645, 1, 1930324, 132392, '2017-09-09');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930326, 'The New Baking', 'Claire Ptak of London''s Violet Bakery demonstrates how to under-whip egg whites for a lighter cake; chocolate, prune and rum cake; brown sugar tart with single-crust pie dough.', 93645, 2, 1930326, 132392, '2017-09-16');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930327, 'From Thailand with Love', 'Christopher Kimball travels to Chiang Mai, Thailand to get lessons in Thai cooking from Andy Ricker. Thai fried rice; Thai-style coleslaw with mint and cilantro; pickled chilies; Thai chicken.', 93645, 3, 1930327, 132392, '2017-09-23');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930330, 'Tahini Rules!', 'Milk Street Cook Rayna Jhaveri shows how to make Turkish meatballs with lime-yogurt sauce; Israeli hummus; sweet-and-sour mint dressing; tahini swirl brownies.', 93645, 4, 1930330, 132392, '2017-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930332, 'Mexico Every Single Day', 'Milk Street visits Mexico for an insider view on Shrimp in chipotle sauce; Central Mexican guacamole; chili-pineapple margarita; cilantro-jalapeno adobo sauce.', 93645, 5, 1930332, 132392, '2017-10-07');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930334, 'Milk Street Suppers', 'Milk Street Cook Catherine Smart shows Christopher Kimball how to make Georgian chicken soup; cracked potatoes with vermouth, coriander and fennel; fluffy olive oil scrambled eggs; seasoning a carbon steel pan.', 93645, 6, 1930334, 132392, '2017-10-14');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930335, 'Milk Street Italian', 'Italy provides inspiration as Matthew Card shows how to make Italian flatbread; ricotta-semolina cheesecake; gemelli pasta with chevre, arugula and walnuts; frying eggs.', 93645, 7, 1930335, 132392, '2017-10-21');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930336, 'Simply Spanish', 'Matthew Card makes Garlic soup; Spanish spice-crusted pork tenderloin bites; kale salad.', 93645, 8, 1930336, 132392, '2017-10-28');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930337, 'Not Your Mother''s Cake', 'Catherine Smart shows how to make Whipped cream biscuits with macerated strawberries with lime; lemon-buttermilk pound cake; prepping a pan; pistachio-cardamom loaf cake.', 93645, 9, 1930337, 132392, '2017-11-04');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930338, 'Milk Street Menu', 'Milk Street Cook Matthew Card shows how to make No-sear lamb or beef; chickpea stew; harissa; caramel oranges.', 93645, 10, 1930338, 132392, '2017-11-11');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930340, 'Milk Street Holidays', 'Milk Street Cook Catherine Smart makes Prune, peppercorn and herb-rubbed roast beef; rye-on-rye sticky toffee pudding; skillet-charred Brussels sprouts; kitchen cabinet essentials.', 93645, 11, 1930340, 132392, '2017-11-18');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930342, 'Crazy Noodles', 'Milk Street visits Peru to learn a new way to make Peruvian pesto; soba with miso butter and asparagus; pisco sours; Trapanese pesto, a Sicilian pasta dish; kitchen cabinet essentials.', 93645, 12, 1930342, 132392, '2017-11-25');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930344, 'Japan Fried Chicken', 'Milk Street Cook Catherine Smart demonstrates Japanese fried chicken; Japanese potato salad; sweet-and-spicy ginger green beans.', 93645, 13, 1930344, 132392, '2017-12-02');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930346, 'Home Cooking in Taiwan', 'The classic flavors and ingredients of Taiwanese cooking from Chuang Pao-hua of the Chung-hua Culinary Teaching Center; Raoche Street Night Market; Kun-Yin Cheng of the Shin Yeh restaurant; how to make Taiwanese beef noodle soup and more.', 93645, 1, 1930346, 132395, '2018-09-07');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930347, 'Quick Suppers from Madrid', 'Features Joaquín Felipe of Florida Retiro; how to make pork and chorizo with piquillo peppers with chef Abraham García of Restaurante Viridiana; Spanish ratatouille; and how to make sherry-soaked French toast.', 93645, 2, 1930347, 132395, '2018-09-14');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930348, 'Middle East Classics', 'The secret of making perfect puffed pita bread at home; how to make sumac-spiced chicken; and how to apply Middle Eastern flavors to salad with a recipe for fattoush.', 93645, 3, 1930348, 132395, '2018-09-21');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930349, 'Japanese Tuesday Nights', 'Culinary instructor Elizabeth Andoh on how to make skillet glazed chicken; chicken teriyaki rice bowl; and pork and vegetable miso soup.', 93645, 4, 1930349, 132395, '2018-09-28');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930350, 'Easy French Desserts', 'French apple cake; rich, yet light chocolate-orange tart; and pastry chef David Lebovitz''s recipe for salted butter caramel-chocolate mousse.', 93645, 5, 1930350, 132395, '2018-10-05');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930351, 'Secrets of Thailand', 'Transforming a simple bowl of broth and rice into an explosion of flavors. Includes Thai rice soup; Thai stir-fried spinach; and an easy Thai beef salad.', 93645, 6, 1930351, 132395, '2018-10-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930352, 'Pizza and Pasta', 'Features Italian-inspired recipes. Includes roasted mushroom pizza with fontina and scallion; cacio e pepe; and a simple shaved zucchini and herb salad with parmesan.', 93645, 7, 1930352, 132395, '2018-10-19');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930353, 'Tunisian Couscous', 'North African chicken couscous; chickpea and harissa soup; and how to make a harissa.', 93645, 8, 1930353, 132395, '2018-10-26');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930354, 'New Mexico, Old Mexico', 'Preparing a moist and flavorful carne adovada; how to make Mexican chicken soup with tomatillos and hominy; and how to bake a moist cake without an oven.', 93645, 9, 1930354, 132395, '2018-11-02');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930355, 'Taipai Cooking Lesson', 'The secret to making the flakiest scallion pancakes; and Taiwanese five-spice pork with rice.', 93645, 10, 1930355, 132395, '2018-11-09');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930356, 'South African Barbecue', 'Exploring the various colors, flavors and textures of South African cooking.', 93645, 11, 1930356, 132395, '2018-11-16');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930357, 'Porchetta at Home', 'The perfect recipes for wintertime meal; fennel-rosemary porchetta; chocolate-hazelnut crostata; and mash potatoes with caraway-mustard butter.', 93645, 12, 1930357, 132395, '2018-11-23');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930358, 'Chicken from Paris to the Middle East', 'How to elevate simple chicken recipes using techniques and flavors from around the world.', 93645, 13, 1930358, 132395, '2018-11-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930359, 'The Japanese Quick Cook', 'Exploring Japan and it''s cuisine Includes Japanese-style rice with flaked salmon and shiitake mushrooms; salt-pickled radish and red onion; and yakiudon with pickled ginger.', 93645, 14, 1930359, 132395, '2018-12-07');
