INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930363, 'Chicken the Chinese Way', 'How to bring Chinese cooking techniques to the home kitchen. Includes preparing crispy Sichuan-chili chicken; and ginger-scallion steamed cod.', 93645, 18, 1930363, 132395, '2019-01-04');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930364, 'South American Classics', 'Exploring the South American food, notably from Colombia and Peru.', 93645, 19, 1930364, 132395, '2019-01-11');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930366, 'Every Day Turkish Favorites', 'Features Turkish-inspired techniques and flavors, including cooking white beans, how to make the easiest Turkish red lentil soup.', 93645, 20, 1930366, 132395, '2019-01-18');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930367, 'From Vietnam to Burma', 'Exploring a variety of South East Asian dishes. Includes Vietnamese meatball and watercress soup; coconut cashew cake; and stir-fried chicken with snap peas and basil.', 93645, 21, 1930367, 132395, '2019-01-25');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930368, 'Singapore Satay, Soup and Sling', 'Exploring the Singaporean cuisine, including Singapore chicken satay with a quick broil and marinade; shrimp and chicken noodle soup; the Singapore sling; and coconut-ginger rice.', 93645, 22, 1930368, 132395, '2019-02-01');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930369, 'West African Weeknight Supper', 'Exploring the Senegalese cuisine. Includes Senegalese braised chicken with onions and lime; and Senegalese avocado and mango salad with rof.', 93645, 23, 1930369, 132395, '2019-02-08');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930370, 'The Oaxacan Kitchen', 'In the Season 3 premiere, Christopher Kimball travels to Oaxaca, Mexico, where he meets Jesús Ochoa, the sous chef at Criollo Restaurant, and learns how to make Carnitas. He then learns how to make Tlayudas from Pilar Cabrera, the owner and head chef of La Olla.', 93645, 1, 1930370, 132397, '2019-09-06');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930371, 'The Joy of Cooking Lebanon', 'Christopher Kimball travels to Beirut to learn how to make classic Lebanese comfort foods with chef Mohamad El Zein, the owner of Moona Restaurant, and cookbook author Anissa Helou.', 93645, 2, 1930371, 132397, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1930372, 'Italian The Right Way', 'Lynn Clark prepares Italian dishes such as quick risotto with fresh herbs and spaghetti al Limone.', 93645, 3, 1930372, 132397, '2019-09-20');
