INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1934150, 'Our Playground', 'A two-part series evoking deep nostalgia and childhood memories, looking at Australian identity through the prism of the Pool. Celebrates sacred spaces from the billabong, to public, ocean, backyard, motel and Olympic pools.', 93835, 1, 1934150, 132726, '2019-09-22');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1934157, 'Our Battleground', 'We look beneath the seductive, aqua-coloured waters of the pool to reveal its hidden history at the centre of battles over race, gender, sexuality and religion.', 93835, 2, 1934157, 132726, '2019-09-29');
