INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1934400, 'Hwangan Rest Area', 'In this episode, Baek Jong Won lives up to his fame. He visits farmhouses in Yeongdong and chooses corn, shiitake, and peach as main ingredients. Yang Se Hyeong, Baek Jin Hee, and Jay Park appear on the show to help Jong Won with promoting local products from Yeongdong-gun. As Se Hyeong gets slow in selling food, Jong Won shows him how to put food faster and how to do the plating effectively. Will they succeed in promoting local food and reviving local farms?', 93853, 1, 1934400, 132746, '2019-09-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1934495, 'Rise to Power', 'Discovering a plot to make her a scapegoat for the murder of her husband, the heir to the Southern King, A pregnant May Wong survives an assassination attempt on her life and defies her patriarchal family tradition while plotting her way to power, with the help of Zan her paramour - Taking no prisoners and showing no mercy.', 93860, 1, 1934495, 132762, '2019-09-19');
