INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1934782, 'Isabel', 'When detectives interrogate Isabel, she talks about love, sex and her Dalmatian, forcing Chief Inspector María to take a risk to try and solve a murder.', 93878, 1, 1934782, 132796, '2019-09-20');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1934831, 'Carmen', 'As Luisa, María and Rai question Carmen, whose younger sister was found drowned in a bathtub, they become suspicious the woman is hiding something.', 93878, 2, 1934831, 132796, '2019-09-20');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1934832, 'Carmelo', 'Tensions flare between the detectives when an interrogation ventures into morally ambiguous territory regarding a suspect personally connected to María.', 93878, 3, 1934832, 132796, '2019-09-20');
