INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1935106, 'Yilmaz', 'A once clear-cut case of domestic violence grows murky as a powerful father-in-law’s lawyer inserts himself into the mix to control the narrative.', 93886, 2, 1935106, 132804, '2019-09-20');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1935107, 'Claudia', 'A detective tries to extract the location of a body from a serial killer’s hardened lover. Then the inspector puts herself on the line and steps in.', 93886, 3, 1935107, 132804, '2019-09-20');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1934845, 'Émilie', 'As a woman recounts her memories of the attack at the Bataclan, which killed her boyfriend, detectives become convinced that she''s hiding something.', 93888, 1, 1934845, 132806, '2019-09-20');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1935094, 'Caroline', 'After a casualty at a building site, the team interrogates a construction executive who seems to know more about the victim than she''s letting on.', 93888, 2, 1935094, 132806, '2019-09-20');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1935095, 'Jérôme', 'Summoned to work before dawn, the team questions a sales manager suspected of a violent hate crime. Audrey makes a bid to win her colleagues'' trust.', 93888, 3, 1935095, 132806, '2019-09-20');
