INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1944759, 'Night of the Wolves', 'Brister and Garcia seek clues to the origins of the demonic creatures while Isabela, Jesus and Silencio do the same as they mourn their fallen master.', 93953, 3, 1944759, 132966, '2019-10-03');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1944760, 'Caged Dogs', 'After uncovering the truth about their peaceful town, Isabela and Jesus are arrested while Silencio becomes a fugitive. El Balde comes to San Simon.', 93953, 4, 1944760, 132966, '2019-10-03');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1944761, 'Blindfold', 'El Balde terrorizes the town of San Simon while Chiu''s students meet Lo, their former master''s brother. Brister and Garcia try to rescue Garabina.', 93953, 5, 1944761, 132966, '2019-10-03');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1944762, 'Reunion', 'Lo''s true nature emerges. Isabela, Silencio and Jesus join forces with Brister and Garcia to raid El Balde''s compound and find his mother, Alejandra.', 93953, 6, 1944762, 132966, '2019-10-03');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1944763, 'Between This World and the Next', 'An earth-shattering showdown unfolds between El Balde and his mother, Alejandra, who has possessed the body of Isabela. Silencio succumbs to anger.', 93953, 7, 1944763, 132966, '2019-10-03');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1944764, 'The Empty Place', 'The team battles a surprising nemesis with seemingly insurmountable powers. He reveals Chiu''s secret past -- and offers Silencio a fateful choice.', 93953, 8, 1944764, 132966, '2019-10-03');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937105, 'Episode 1', 'Oprah and Ta-Nehisi Coates plunge into his new novel, The Water Dancer—its hard truths, stirring love story, and magic.', 93967, 1, 1937105, 132990, '2019-11-01');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937112, 'Endeavour and Tahiti', 'On the 250th anniversary of Cook leaving Plymouth, Sam Neill visits Tahiti in the first of six episodes to follow Cook’s journey around the Pacific, and hears from Tahitians about what Cook means 250 years on. Sam encounters ardent enthusiasts and practitioners of Tahiti’s vibrant culture. Some of the traditions are old, some new and when lost, he learns, the Tahitians are happy to make them up.', 93970, 1, 1937112, 132994, '2018-08-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1938400, 'Episode 33', '', 93988, 33, 1938400, 133046, '2012-05-06');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1938401, 'Episode 34', '', 93988, 34, 1938401, 133046, '2012-05-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1938402, 'Episode 35', '', 93988, 35, 1938402, 133046, '2012-05-20');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1938403, 'Episode 36', '', 93988, 36, 1938403, 133046, '2012-05-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937113, 'Endeavour and New Zealand', 'Speaking with historians, activists, artists and locals, Sam delves into a deep history of trade, tradition and turbulent conflict. To his surprise Maori oral memories of Tupaia are more strong and vivid than those of Cook. Reconnecting with lost Polynesian history was far more potent than awe at the foreign goblins.', 93970, 2, 1937113, 132994, '2018-09-03');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937114, 'Endeavour and Australia', 'Sam travels from Botany Bay up the east coast to Cooktown, learning about a country that far from being nobodies’ land was comprehensively inhabited by a well established culture.', 93970, 3, 1937114, 132994, '2018-09-10');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937115, 'Resolution and the Great Southern Continent', 'Sam visits New Zealand, Tonga, Vanuatu, and Norfolk Island before completing one of Cook’s unfinished ambitions by touching down on Antarctica. For Sam this episode, in a much more intimate way, mirrors what many consider Cook’s greatest achievement, the breadth and extent of the second voyage.', 93970, 4, 1937115, 132994, '2018-09-17');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937116, 'Resolution and the Northwest Passage', 'Sam Neill continues to follow the path of the Resolution, again via through New Zealand and Tonga onto Canada and Alaska, experiencing the Pacific as never before.', 93970, 5, 1937116, 132994, '2018-09-24');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937117, 'Resolution and Hawaii', 'Back in Australia Sam views an unfinished tapa waistcoat abandoned by Elizabeth Cook after his death – a poignant memento. A larger than life stainless steel sculpture of the man by Micheal Parakowhai is the focus of Sam’s reflections on Cook. Finally on an uninhabited islet in mid- Pacific Sam concludes his journey from being a ‘mere actor’ when he set out to becoming ‘a man of the Pacific.’', 93970, 6, 1937117, 132994, '2018-10-01');
