INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937729, 'Beetlejuice, Beetlejuice, Beetlejuice!', 'Sandra Lee challenges three chefs to create gingerbread masterpieces in honor of the 30th anniversary of Beetlejuice. Judges Jason Smith and Jamika Pessoa are joined by guest judge Elvira, Mistress of the Dark, to determine who will advance to the finale and get a shot at the $25,000 grand prize.', 93984, 1, 1937729, 133039, '2018-10-07');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937730, 'Monster Mash', 'Sandra Lee challenges three talented chefs to create a Halloween party for the ghosts, ghouls and many other stars of the frightful holiday. Chef and restauranteur Raffaele Ronca joins as guest judge.', 93984, 2, 1937730, 133039, '2018-10-14');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937731, 'Fright Night', 'Host Sandra Lee tasks three chefs with creating a haunted theme park in gingerbread form. Each competitor faces their own dark night of the soul during the competition and must rally in order to stay in the game. Cake designer Barbarann Kym joins as guest judge.', 93984, 3, 1937731, 133039, '2018-10-21');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937732, 'The Ultimate Haunted House', 'Three Haunted Gingerbread Showdown winners return to compete in the frightful finale! Each chef must create the ultimate haunted house out of gingerbread. Judges Jamika Pessoa and Jason Smith are joined by some very special Halloween fans that are expecting epic work and will decide on a winner.', 93984, 4, 1937732, 133039, '2018-10-28');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1937741, 'Calling All Ghostbusters', 'Slimer, the Keymaster and the Stay Puft Marshmallow Man put the "haunted" in Haunted Gingerbread Showdown as host Clinton Kelly challenges three gingerbread artists to create pieces celebrating the 35th anniversary of the smash hit movie Ghostbusters.', 93984, 1, 1937741, 133040, '2019-10-06');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946628, 'When Aliens Attack', 'Host Clinton Kelly challenges three gingerbread artists to create pieces that depict the chaos of an alien attack.', 93984, 2, 1946628, 133040, '2019-10-13');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946629, 'The Mummy''s Ancient Curse', 'Three gingerbread artists take on the mummy''s ancient curse when host Clinton Kelly challenges them to use gingerbread to tell a story of mummies run amok.', 93984, 3, 1946629, 133040, '2019-10-20');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946630, 'Scares on Elm Street', 'Freddy Krueger is back and ready to menace three gingerbread artists as they face the ultimate nightmare. The finalists have one week to create pieces that celebrate the 35th anniversary of A Nightmare on Elm Street.', 93984, 4, 1946630, 133040, '2019-10-27');
