INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939308, 'Rent Is Due', 'The fellas come up short on rent, and now face some perilous options.', 94031, 1, 1939308, 133134, '2019-09-04');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939309, 'Leroy Pays a Visit', 'Out of options, the fellas decide to borrow money from a drug lord to pay back their late rent.', 94031, 2, 1939309, 133134, '2019-09-05');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939310, 'The Plan', 'The fellas devise a plan to pay the drug lord his money back.', 94031, 3, 1939310, 133134, '2019-09-12');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939312, 'Busted', 'The fellas experience some major setbacks in their attempt to execute the plan.', 94031, 4, 1939312, 133134, '2019-09-24');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1945857, 'The Scammer', 'The fellas are held up by a scammer while danger lurks nearby.', 94031, 5, 1945857, 133134, '2019-10-04');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939343, 'Cursed!', 'The four competing bakers must beware of evil spells as Duff Goldman provides cursed ingredients like blood oranges, black garlic and forbidden rice in the first round challenge. One eliminated baker is haunted by their mistakes while the final three head to their home bakeries to construct elaborate showpiece cakes that transform from calm to cursed. Delicious demons and wicked monsters amaze the judges as they crown a winner.', 94034, 1, 1939343, 133139, '2019-09-23');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942451, 'It''s Alive!', 'Duff Goldman challenges the bakers to wake the dead by designing dead-to-alive themed cakes, mixing ingredients that are dead and dark with those that are alive and colorful. One competitor''s cake is deemed dead on arrival, and the remaining three bakers head home to create their showstoppers. Spectacular effects combine with the Halloween spirit as cake creatures rise from the dead to scare up a winner.', 94034, 2, 1942451, 133139, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1948404, 'Monster Wedding!', 'Duff Goldman officiates the monster of all wedding cake competitions as the bakers must create cakes fit for monstrous matrimony. Using iconic Halloween candies like candy corn, chocolate chews and circus peanuts, the bakers whip up ghoulish designs with sweet flavors. One wedding crasher is eliminated as the remaining three competitors return to their home bakeries to craft monster-sized cakes. Frightening transformations and delightful flavors scare the judges into declaring a winner.', 94034, 3, 1948404, 133139, '2019-10-07');
