INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939847, 'The Nest', 'When the Rescue Riders save Viking chief Duggard, they’re invited to visit his village of Huttsgalor, where they must prove they''re kind and helpful.', 94045, 1, 1939847, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939848, 'Deep Trouble', 'Dak''s lack of planning gets him, Cutter and Winger lost with Elbone in the Maze Caves, and Leyla''s overthinking threatens the effort to rescue them.', 94045, 2, 1939848, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939849, 'Boo to You', 'Burple gets spooked by the legend of a ghost called the Phantom Fang. But when he senses the story is real, he can''t get his friends to believe him.', 94045, 3, 1939849, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939850, 'Where There''s Smoke', 'After Magnus accuses Cutter of setting fires near the village that could hurt the sheep, the Riders have to put them out and find the real culprit.', 94045, 4, 1939850, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939851, 'Heavy Metal', 'The Rescue Riders get stuck in a cave with their rival, Magnus, during a race to find a new source of an important mineral.', 94045, 5, 1939851, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939852, 'Iced Out', 'Frustrated that she''s not fitting in with the team, Aggro goes off on her own with Elbone on a mission to save a dragon egg trapped in ice.', 94045, 6, 1939852, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939853, 'Sick Day', 'When the other dragons come down with the flu, Summer must overcome her fear of eels to retrieve the cure and get her friends back in the air.', 94045, 7, 1939853, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939854, 'Bad Egg', 'Magnus hatches a plan to hide in an egg to spy on the Rescue Riders. But things get all scrambled when a mama dragon takes him to her nest.', 94045, 8, 1939854, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939855, 'Home Alone', 'Aggro, Burple and Cutter are left alone in the roost to care for some dragon eggs, but a trio of tricky Slinkwings want those eggs for themselves.', 94045, 9, 1939855, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939856, 'Slobber Power', 'Cutter gets a chance to be a "mom" when a newly hatched dragon bonds with him, and they''ll both be needed to get the others out of a tangled mess.', 94045, 10, 1939856, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939857, 'Crash Course', 'Burple and Winger each injure a wing while they''re with Dak, and only teamwork can get them home. At the roost, Cutter gets stuck in a puddle of goo.', 94045, 11, 1939857, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939858, 'Furious Fun', 'The Rescue Riders have a "Dragon Day" to show their skills to a young fan, but Aggro skips it to hang out with her new fun -- but reckless -- friends.', 94045, 12, 1939858, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939859, 'Grumblegard Part 1', 'While the others care for baby dragons at the roost, Dak, Winger, Burple and Aggro come face-to-face with a grumpy old dragon on a dangerous island.', 94045, 13, 1939859, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1939860, 'Grumblegard Part 2', 'The Rescue Riders plan to team up with the Slinkwings when an angry Grumblegard threatens Huttsgalor. But their old enemies may be up to new tricks.', 94045, 14, 1939860, 133155, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940574, 'Memory', 'Jack meets the world memory champion and a man who can remember every day of his life.', 94050, 1, 1940574, 133162, '2016-04-04');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940586, 'Faces', 'Jack meets a man who is unable to recognise faces and puts a super-recogniser to the test.', 94050, 2, 1940586, 133162, '2016-04-11');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940591, 'Phantom Limb', 'Jack joins amputees trying to find out why they feel sensations in their missing limbs.', 94050, 3, 1940591, 133162, '2016-04-18');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940597, 'Seeing Is Believing', 'Jack meets a man who has bizarre hallucinations and witnesses cutting edge surgery.', 94050, 4, 1940597, 133162, '2016-04-25');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940599, 'Time', 'Jack meets a woman who has lost all sense of time and reveals how time can be elastic.', 94050, 5, 1940599, 133162, '2016-05-02');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940618, 'The Senses', 'Jack meets people with synaesthesia and experiences multisensory gastronomy.', 94050, 6, 1940618, 133162, '2016-05-09');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940623, 'Pain & Fear', 'Wim Hof teaches Jack how to control his pain and plunge into the ice cold sea.', 94050, 7, 1940623, 133162, '2016-05-16');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940633, 'Creativity', 'Jack meets a man with Sudden Artistic Output syndrome and unleashes his creativity.', 94050, 8, 1940633, 133162, '2016-05-23');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940637, 'Sleep', 'Jack meets two people who can’t stop falling asleep and finds out the consequences of sleep deprivation.', 94050, 9, 1940637, 133162, '2016-05-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1940639, 'Language', 'Jack meets a British man who awoke from a coma speaking only fluent French.', 94050, 10, 1940639, 133162, '2016-06-06');
