INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942051, 'Over the Moon Pie', 'Host Jonathan Bennett invites three chefs to get their snack on at the 25th Annual RC-MoonPie Festival in Bell Buckle, Tenn. In two rounds of competition, they transform the South''s favorite snack staple, the MoonPie, into all-new dishes that will wow the festival crowd as well as judges Maneet Chauhan, singer-songwriter Emily Minor and Jim Stacy, earning the best chef a $5,000 prize.', 94134, 1, 1942051, 133304, '2019-09-29');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942149, 'Steril', 'They have money, career and family. They have everything. But they are bored. Hermione wants children with Adam. It''s just that Adam is sterile, but Hermione doesn''t know that.', 94137, 1, 1942149, 133310, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942958, 'Horer og hummer på Hankø', 'Two prostitutes run off with Williams'' wallet just before the big party he and Celine are holding at their country house. William approaches the breaking point when a guest annoys him.', 94137, 2, 1942958, 133310, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942959, 'Deg eller meg', 'The boys go on sick visits to William, who has a big bandage on his head and is really out to drive. Adam thinks Hermione is too upset about her missing pregnancy and asks Henrik for an unusual friend service.', 94137, 3, 1942959, 133310, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942960, 'Face off', 'Jeppe invites Henrik and William to a boy''s evening with little food and lots of drinks and baptisms. Henrik tells Hermione about the deal with Adam, and Hermione immediately takes the opportunity to take revenge.', 94137, 4, 1942960, 133310, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942961, 'Hun er en hore', 'Adam must shut up until he finds out how to get Hermione to lose face. William is discharged from the hospital, but Celine has plans other than taking care of someone who has tried to kill her.', 94137, 5, 1942961, 133310, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942962, 'Søte og rare gutter', 'The guys are gathered for a wedding. William opens up to them and for a moment the mood is top, but Hermione''s talk with the guests causes Adam to fire up.', 94137, 6, 1942962, 133310, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942963, 'Dagen derpå', 'Jeppe and Adam head to Saint-Tropez to clean up William''s financial mess, only to find that everything is even messier than they thought. Henrik and William fool a journalist who wants to write about them.', 94137, 7, 1942963, 133310, '2019-09-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942964, 'Det var meg', 'William is left to himself by Celine, and badly needs someone to take care of him and get his company back on their feet. Hermione plays a high game to ensure an independent and financially good life.', 94137, 8, 1942964, 133310, '2019-10-04');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942324, 'Law Abiding Citizen', 'Naval officer Kawas Nanavati commits a gruesome murder with his service revolver in broad daylight. For the Indian Navy, Nanavati is a hero. The prosecution and the defendant are set to fight this seemingly open and shut case that makes headlines and scandalizes the entire nation.', 94144, 1, 1942324, 133335, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942326, 'The Runaway Jury', 'Chandu Trivedi reluctantly accepts assistance from Sindhi lawyer Ram Jethmalani. Before the first hearing, the prosecution and the defense must select the jury members. Both Trivedi and Khandalawala try to select members who will take the final verdict in favour of their candidate.', 94144, 2, 1942326, 133335, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942327, 'Rules of Engagement', 'The prosecution is convinced that Kawas will plead guilty in the court. However, the defense tries to persuade Kawas to plead not guilty. For this Karanjia intervenes and meets Kawas and his lawyer. Meanwhile, Ram confronts Trivedi on his lackluster argument in court.', 94144, 3, 1942327, 133335, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942328, 'State of Play', 'The primary witnesses are presented in the court for examination. Trivedi is shocked when policer officer Lobo who is also a prime witness is not allowed to give his testimony in the courtroom.', 94144, 4, 1942328, 133335, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942329, 'Anatomy of Murder', 'The case takes an unexpected turn when Kawas Nanavati tells the court what happened on the day when Prem Ahuja was killed. He confesses to pulling the trigger on Ahuja, but only accidentally. Meanwhile, the divided jury members visit the crime scene.', 94144, 5, 1942329, 133335, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942330, 'In the Bedroom', 'Trivedi and Khandalawala argue the scientific facts of bullet injuries by examining their respective expert witnesses in the courtroom. As Sylvia agrees to be the ‘villain’ to save her husband, Khandalawala urges her to tell everything about her extra marital affair with businessman Prem Ahuja.', 94144, 6, 1942330, 133335, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942331, 'Find Me Guilty', 'In the next hearing, Sylvia Nanavati puts her side of the story in the courtroom. Khandalawala asks her some shocking and humiliating questions in front of the jury & public in the courtroom. And Jethmalani presents some scandalizing evidence. Sylvia is reduced to tears, whereas Kawas feels insulted.', 94144, 7, 1942331, 133335, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942332, 'The Devil’s Advocate', 'State Vs Nanavati case goes for the final hearing. Both prosecution and defense present their conclusive arguments. Trivedi appeals the jury to be free of any bias while giving their verdict, whereas, Khandalawala urges the jury to keep the nation’s interest first. Now the jury will decide.', 94144, 8, 1942332, 133335, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942333, 'The Verdict', 'Honourable Judge R.B Mehta is shocked at the jury’s verdict in favour of Kawas Nanavati. He is forced to exercise his judicial powers and nullify the judgement passed by the jury. He refers the case to the High Court. Meanwhile, Rusie Karanjia unites the entire Parsi community and convinces them to campaign for mercy petition for Kawas.', 94144, 9, 1942333, 133335, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942334, 'Justice for All', 'Everyone involved in the case tries to seek a sense of normalcy. Mamie tries to seek closure by selling off her mansion. Kawas is no more with the Navy and finds an alternate profession to support his family. But he doesn’t feel at home in Bombay anymore and decides to immigrate to another country & settle down.', 94144, 10, 1942334, 133335, '2019-09-30');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942512, 'Bigfoot Trailer', 'Trailer for upcoming animated series Bigfoot.', 94155, 1, 1942512, 133356, '2019-09-19');
