INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1942501, 'Community Profile', 'Bigfoot is offended that he’s not featured heavily in the new tourism video for the town of Swell, so he decides to make his own video with his friends to prove the “Bigfoot Brand” can help the town prosper', 94155, 1, 1942501, 133355, '2019-09-29');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947014, 'Bigfoot Meet Girl', 'Feeling lonely, Bigfoot dreams of having a girlfriend to keep him company - and his dream comes true! Until he proposes and everything falls apart.', 94155, 2, 1947014, 133355, '2019-10-06');
