INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946633, 'What is Reality?', 'What if the very fabric of space and time isn''t made of one-dimensional strings or energy as we think of it, but instead was simply a code or a language made from a geometric projection? Quantum Gravity Research is a Los Angeles based team of mathematicians and physicists working on developing a theoretical framework for a first-principles unified quantum gravity theory they call emergence theory. Still in the early stage of development, emergence theory attempts to unify, through mathematical and scientific rigor, the theory of relativity, quantum mechanics, and consciousness.', 94334, 1, 1946633, 133645, '2017-03-04');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947119, 'No Laughing in a High School', 'Matsumoto, Yamasaki, Endō, and Tanaka are punished after losing another Russian Roulette style game where they shocked themselves. This time, they are sent to ''high school'' for one day. The punishment weapon for this game is the shinai, and Hamada participated as one of the hang-men, frequently delivering a strong kick along with the regular punishment. It was revealed that this game was shot during Matsumoto''s birthday.', 94370, 1, 1947119, 133701, '2005-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946635, 'Hacking Reality', 'Is there an 8-dimensional "engine" behind our universe? Join Marion Kerr on a fun, visually exciting journey as she explores a mysterious, highly complex structure known simply as ''E8''--a weird, 8-dimensional mathematical object that for some, strange reason, appears to encode all of the particles and forces of our 3-dimensional universe.  Meet surfer and renowned theoretical physicist Garrett Lisi as he rides the waves and paraglides over the beautiful Hawaiian island of Maui and talks about his groundbreaking discovery about E8 relates deeply to our reality; and learn why Los Angeles based Klee Irwin and his group of research scientists believe that the universe is essentially a 3-dimensional "shadow" of this enigmatic... thing... that may exist behind the curtain of our reality.', 94334, 1, 1946635, 133646, '2018-05-24');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946640, 'Episode One', 'Learn social media''s addictive power. Discover NFL protests’ ties to 1968. See how Wall Street women fought harassment, and a python invasion. Andy Borowitz compares politics ads to cigarettes.', 94338, 1, 1946640, 133650, '2019-10-07');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946641, 'Episode Two', 'Uncover crime evidence pulled from DNA websites. See how drug rules stem from a pill’s side effects. Learn how a screen addiction cure is rooted in the past and why Americans are ambivalent about robots. Andy Borowitz objects to “no news.”', 94338, 2, 1946641, 133650, '2019-10-08');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946642, 'Episode Three', 'Learn why crime witnesses fail to act. Meet a Naval officer who transformed the military. Psychedelic drugs like LSD are back in the lab. Follow the voyage of a trash barge that persuaded us to recycle. Andy Borowitz highlights lunar hoaxes.', 94338, 3, 1946642, 133650, '2019-10-14');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946643, 'Episode Four', 'Hear how President Trump is taking on the press with a time-tested strategy. Learn the origins of vaccine fears. Discover the story behind free agency, and a law that was meant to rescue wild horses. Andy Borowitz bemoans the no-apology apology.', 94338, 4, 1946643, 133650, '2019-10-15');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946646, 'Episode Five', 'Learn how texting could reduce suicides. See why surrogate parenthood is still being shaped by Baby M. Shine a light on lead, banned but not gone. Climate help may come from the Cold War. Andy Borowitz recalls a flaming river.', 94338, 5, 1946646, 133650, '2019-10-21');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946644, 'Episode Six', 'Discover the lessons from a 1970s public housing experiment. Understand the roots of newborn testing. Explore head injuries in pro sports. See why too few people, not too many, is a problem. Andy Borowitz takes on Space Force.', 94338, 6, 1946644, 133650, '2019-10-22');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946645, 'Episode Seven', 'Understand immigration controversies that echo the past. Learn the truth about a lawsuit over hot coffee. Uncover the origin of special ops. See how risks are measured after Challenger. Andy Borowitz looks at Anita Bryant’s unintended influence.', 94338, 7, 1946645, 133650, '2019-10-28');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946647, 'Episode Eight', 'Discover how sex ed programs are informed by past failures. Debunk a myth about crime. Uncover the story behind new AIDS hot spots. Learn the legacy of Napster. Andy Borowitz tackles TV bullying.', 94338, 8, 1946647, 133650, '2019-10-29');
