INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946791, 'Creepy Clowns', 'They''re meant to be the most fun-loving entertainment at the big top, but three teams of bakers create clown cakes that will haunt the dreams of kids and adults alike! In addition to the creep-out clown cakes, Vivian Chan and Zac Young challenge the bakers to create concession stand sideshow treats.', 94355, 1, 1946791, 133672, '2019-10-05');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946792, 'Snake Charmer Showdown', 'Nothing is ever normal in the sideshow tent, so Vivian Chan and Zac Young challenge the three teams of bakers to imagine a dangerous snake charming gone wrong. In addition, each team must bake a sideshow sweet treat with a surprise inside to complement their jaw-dropping snake cake.', 94355, 2, 1946792, 133672, '2019-10-17');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946796, 'Flame Show', 'Three teams of bakers design smokin'' hot cakes inspired by the infamous fire breather. Vivian Chan and Zac Young also challenge them to present a fiery sideshow sweet to go with their dangerous cake displays.', 94355, 3, 1946796, 133672, '2019-10-19');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1946798, 'Misfortune Teller', 'Three teams of bakers create mystical fortune teller cakes, but in this big top of horrors, the crystal ball only reveals tragedy and disaster. Vivian Chan and Zac Young also task the teams with creating a shocking sideshow sweet to complement their main act.', 94355, 4, 1946798, 133672, '2019-10-26');
