INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947116, 'No Laughing in a Hot Spring Inn', 'The first No-Laughing Batsu Game, shot in Yamanashi, it served as the punishment for Matsumoto, Yamasaki, Endō, and Tanaka, for losing to Hamada in a 4 vs. 1 bowling match (which aired on May 18, 2003). Getting caught laughing during this game resulted in having a dart from a blow-gun shot into the buttocks. Given the newness of the concept, this punishment game was carried out in a somewhat "primitive" way: the Watchers were more lenient with enforcing the rule, and the auto sound blared rough over the sound-system that was set up through the facility.', 94370, 1, 1947116, 133698, '2003-07-27');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947145, 'No Laughing in Yugawara Inn', 'In a Russian Roulette style game involving sushi, Yamasaki, Tanaka, and Hamada lost and were punished in the second spa-themed no-laughing batsu game, filmed at Yugawara, Kanagawa. A riding crop was the punishment device employed. Matsumoto and Endo joined the game half-way as "The Mad Brothers." This batsu game features Endō''s luchador character Dynamite Shikoku.', 94370, 1, 1947145, 133700, '2004-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947129, 'No Laughing at a Police Station', 'This batsu game premiered as a three-hour special. The losing players were Yamasaki, Hamada, and Endō, who lost at a Russian Roulette style game using large tubs suspended from the studio ceiling, and cutting loose the one''s that fell, thus earning them a spot in the Batsu Game. Matsumoto and Tanaka avoided the batsu, and later appeared in the game, visiting the three punished players. The hang-men were especially rough when giving discipline to offenders.', 94370, 1, 1947129, 133702, '2006-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947130, 'No Laughing in a Hospital', 'For this special, Downtown, Yamasaki, and Cocorico all took part of the most infamous punishment game — and they were forced to cross-dress as nurses for the game''s duration. Yamasaki, who had just completed a hospital stay after being treated for enteritis, was permitted to take some absences during the game. Among the famous guests who performed here were Sonny Chiba, Masahiro Chono and many other comedy duos in Japan. (As a side note, it was during this game that the record at the time for most punishment-strikes ever inflicted was set, with Hitoshi Matsumoto having received a total of 259 of them.', 94370, 1, 1947130, 133703, '2007-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947131, 'No Laughing at a Newspaper Agency', 'For the second time around, all five members of the regular cast took part in the annual punishment game. This year the chosen setting was a newspaper agency. The members had to go to a number of mock press conferences dressed as journalists. Endō''s ex-wife Chiaki made a guest appearance in a conference about her "new husband." In keeping with the theme of the punishment game, giant latex pencils were used to strike anyone who had been declared out.', 94370, 1, 1947131, 133704, '2008-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947132, 'No Laughing at the Hotel', 'For the third consecutive time, Yamazaki, Downtown, and Cocorico took part in the annual punishment game. The setting was a hotel and it aired on New Year''s Eve at 6:30pm until 12:30am on New Year''s Day. Numerous cameo and guest appearances were made, including Masahiro Chono, Masahiro Tanaka, Natsumi Ogawa ( Hamada''s wife ), Endō''s ex-wife Chiaki, Jyunji Endō ( Endō''s younger brother), Masako Mori, Ayumi Nakamura, Monta Yoshinori, and Yoshimi Iwasaki.', 94370, 1, 1947132, 133705, '2009-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947135, 'No Laughing at the Spy Agency', 'The members of Gaki no Tsukai partake in their fourth annual punishment game. Filmed in Ibaraki prefecture, this Batsu''s setting was a spy school and it was aired on New Year''s Eve at 6:30pm to 12:30am on New Year''s Day. Over 100 celebrities were involved with the filming including Itao Itsuji, Matsuko Deluxe, Masahiro Chono, Bibari Maeda, Claudia Umemiya and Tatsuo Umemiya.', 94370, 1, 1947135, 133706, '2010-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947136, 'No Laughing at the Airport', 'The Gaki no Tsukai cast participate in the 5th annual punishment game (the 6th New Years show in the No Laughing Series). The filming took place at Ibaraki Airport, in November 2011. Here Hamada, Matsumoto, Yamasaki, Endo and Tanaka were trained to become CA''s (or Flight Attendants). The airing began on New Year''s Eve 31 December 2011 at 6:30pm and ran through 12:30am the next day (Japanese Standard Time). (This year broke through the 2007 record with Matsumoto receiving 302 punishments.)', 94370, 1, 1947136, 133707, '2011-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947137, 'No Laughing Enthusiastic Teachers', 'The cast is dressed as teachers and has to take a hard training in the teacher academy, before they can enter the real school. One big part of the batsu takes place in the Endo-periode, when the casts time-slips back in to time.', 94370, 1, 1947137, 133708, '2012-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947138, 'No Laughing Defense Force', 'The Gaki no Tsukai cast participate in the 7th annual punishment game (the 8th new years show in the No Laughing Series). This game implemented 250 CCD Cameras, 27 ENG units, 70 from technical staff and extra 210 people which brings the total staff number by 500.', 94370, 1, 1947138, 133709, '2013-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947140, 'No Laughing Prison', 'The Gaki no Tsukai cast participate in the 12th annual punishment game for a New Year''s Eve Special', 94370, 1, 1947140, 133710, '2014-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947141, 'No Laughing Detective Agency', 'The Gaki no Tsukai cast participate in the 12th annual punishment game (the 13th new years show in the No Laughing Series).', 94370, 1, 1947141, 133711, '2015-12-31');
INSERT INTO public.episode (id, name, overview, seriesid, numepisode, tvdbid, seasonid, aired) VALUES (1947142, 'No Laughing Science Lab', 'The Gaki no Tsukai cast participate in the 13th annual punishment game (the 14th new years show in the No Laughing Series).', 94370, 1, 1947142, 133712, '2016-12-31');
