INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (93524, 93524, 'August', 'The series tells the story of a criminal investigation into the murder of businessman Paulo Gomes de Aguiar at the beginning of August. In the midst of the Vargas government crisis, the murder case is taken by police commissioner Alberto Mattos, an honest and incorruptible man who is not well regarded by his co-workers, as the place is totally turned over to corruption.', null, 'Ended', 37, 60, '1993-08-24', null, null, null, '/uT196Ywfw1BmFK3YpUAptllZDHx.jpg', 0, '/hCmGf7bwwb4f2oHtwlvaK29AE8c.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (93527, 93527, 'Khaas', 'Saba is a strong, studious young woman who was raised by a family that supports her ambitions. Ammar, her love interest, is a well educated, handsome young man who has it all and knows it. He begins to display narcissistic tendencies shortly after their marriage, which harms their relationship and affects Saba’s self worth. When Ammar’s best friend Faakhir becomes a form of emotional support for Saba, tensions rise between the three, and make for a complicated dynamic.', null, 'Returning Series', 0, 1204, '2019-04-17', null, null, null, '/4TAzNL2xaQNJF6Kht5zTMBj3Qxt.jpg', 0, '/2cNfnpyQ6pF1SDCsai0lfyVl9S3.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (93532, 93532, 'Chiquinha Gonzaga', 'It tells the story of Chiquinha Gonzaga, a revolutionary musician who marked the history of music in Brazil, and challenged the social standards of her time. Chiquinha was raised very comfortably and had an excellent education provided by his father, Jose Basileu, who expected his daughter to be a lady of the imperial court. But after listening to songs played in a black yard and influenced by friends, such as composer Joaquim Callado, Chiquinha begins to make compositions mixing polka and lundu. By imposition of her father, Chiquinha is forced to marry Jacinto, with whom she has three children. However, Jacinto forbids her to play, and she decides to separate from her husband, going against social standards. Chiquinha, then, fights for his freedom to play and will live with the great love of his youth, João Batista de Carvalho Jr., with whom he has a daughter, Alice.', null, 'Ended', 41, 60, '1999-01-12', null, null, null, '/ysdyFaY3WUXOcLZB8I2MEKs53jd.jpg', 0, '/oL62BmgFH422V2j2uqCrHZesNmE.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (93536, 93536, 'Desire', 'Set in the early twentieth century and based on real facts, it tells the love story that led to the murder of one of the greatest Brazilian writers: Euclides da Cunha.', null, 'Ended', 44, 60, '1990-05-27', null, null, null, '/poWaEMXAMMc0HRGOPdWcPne92rC.jpg', 0, '/e2qe37CuCvU2MxSUUpJXyNhhKPN.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (93537, 93537, 'Eureka Seven: AO', 'On the island of Iwado, 13 year-old Ao Fukai lives with an aging doctor after the disappearance of his parents. When Iwado is attacked by an organization known as Secret, Ao unexpectedly finds himself at the controls of the Nirvash, a robotic fighting machine. Alongside his childhood friend Naru Arata, a teen girl with psychic powers, Ao heads into battle, determined to protect his island home.', null, 'Ended', 0, 160, '2012-04-13', null, null, null, '/bz6BevOMMp7udOWXcmGF3lsoX1v.jpg', 0, '/8xVe6uSeniuPC2LdGcnqApKIS1h.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (93541, 93541, 'The Tale of Nokdu', 'A young noble heir named Jeon Nok-du has just discovered that his parents have arranged for him to marry a woman against his will. Jeon Nok-du has no intention of marrying at his parents’ behest and runs away from home. He finds a village to take refuge in, but there is a twist – the village is populated entirely by widows! Jeon Nok-du is forced to go undercover, disguising himself as a woman in order to evade detection. In the village, he encounters a woman named Dong Dong-ju, who discovers his true identity. However, Dong Dong-ju is also hiding a secret – she has also run away from home. Dong Dong-ju is fleeing from an ill-fated gisaeng (courtesan) apprenticeship. Although she is very adept at practical tasks, she is hopeless at singing, dancing, and the other artistic skills required of the gisaeng. Will the unlikely duo succeed in keeping each others’ identities a secret? And what will happen when they begin developing romantic feelings for one another?', null, 'Returning Series', 35, 342, '2019-09-30', null, null, null, '/r8BhphHIruCL2jM4sd1Zs6sMJov.jpg', 0, '/byuyNEvHhD3XBbRySbRZq3dTIhF.jpg');
INSERT INTO public.series (id, tvdbid, name, description, userrating, status, runtime, networkid, firstaired, id_imdb, added, updated, posterurl, followers, bannerurl) VALUES (93544, 93544, 'Top Boy', 'Two seasoned drug dealers return to the gritty street of London, but their pursuit of money and power is threatened by a young and ruthless hustler.', null, 'Returning Series', 50, 213, '2019-09-13', null, null, null, '/mGZpOEaLZTRzWeQMq5SZM5BbDZg.jpg', 0, '/xjSRTfn4w1EKxuVyKNrv5RwI0Jo.jpg');
